import React from 'react'
import { Modal, Button } from 'react-bootstrap'

const { Header, Title, Body, Footer } = Modal

export default function VerticalModal(props) {
  return (
    <Modal
      {...props}
      size="lg"
      aria-labelledby="contained-modal-title-vcenter"
      centered
    ></Modal>
  )
}
